	module.exports = "<div class=\"page001\">\r\n\r\n    <div class=\"row page-header\">\r\n        <div class=\"col-md-8 text-sm-center\" style=\"background-color:#5080AA;\">\r\n            <h2>FreshFind Data</h2>\r\n        </div>\r\n        <div class=\"col-md-4\" style=\"background-color:#93B1CD;\">\r\n            <h4>OCTOBER 2015</h4>\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"row\" style=\"background-color:#C5CCC6;\">\r\n        <div class=\"col-md-8\" style=\"padding:0;\">\r\n            <img src=\"" + __webpack_require__(278) + "\" style=\"width: 100%;\" />\r\n        </div>\r\n        <div class=\"col-md-4\">\r\n            <p>\r\n                A monthly resource which keeps you current on\r\n                Sales/Marketing and new business acquisition\r\n                news and development.\r\n            </p>\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"row\">\r\n        <div class=\"col-sm-12 text-sm-center m-y-2\">\r\n            <h4>\r\n                Finding quality lists and capitalizing on the\r\n                undervalued new business market\r\n            </h4>\r\n        </div>\r\n    </div>\r\n\r\n\r\n\r\n    <div class=\"row\">\r\n\r\n        <div class=\"col-md-4\">\r\n            <p>\r\n                OVERVIEW There are two ways to\r\n                increase your revenue and profit  sell more to current\r\n                customers and find new ones. Today most companies are\r\n                focused on retaining and growing the current customer\r\n                base in this current downturn, as finding new customers\r\n                is much harder and more expensive to do than ever before.\r\n                In general I agree, as any decay of current business\r\n                is not likely to be made up by finding new customers.\r\n                We all know the statistics on the value and ease of\r\n                keeping current customers. This has never been truer\r\n                than in 2010, and will be so, well into the future.\r\n            </p>\r\n            <p>\r\n                On the other hand, there is one large market segment\r\n                where finding new customers is not only easier, but\r\n                also potentially creates long- term value  its the\r\n                new business market segment. The problem is that our\r\n                views of these new business start-ups is somewhat jaded \r\n                out of work people (often calling themselves consultants),\r\n                too small, dont have any money, and will go out\r\n                of business soon. So why bother?\r\n            </p>\r\n\r\n\r\n        </div>\r\n\r\n        <div class=\"col-md-4\">\r\n            <p>\r\n                From a B2B perspective there are always a few firms that\r\n                grow large and prosper  how would you like to have been\r\n                in early with Microsoft, Google or Cisco.\r\n            </p>\r\n            <p>\r\n                My guess is that the companies who paid attention and sold\r\n                to these companies when they were small and\r\n                unknown, created a relationship that lasted and generated\r\n                significant revenue and profit  what we call lifetime value.\r\n            </p>\r\n            <p>\r\n                Even from a B2C perspective, starting a new business is a\r\n                significant event, and if we believe in life change marketing\r\n                (events that trigger a life or behavior change) then\r\n                opportunities exist to sell this new consumer products\r\n                and services that were not needed before based\r\n                on the individual starting a consuming activity.\r\n            </p>\r\n            <p>\r\n                Buying into the opportunity that the new business market offers\r\n                is only the first\r\n                step  thats the easy part. The second and most difficult is\r\n                finding a quality list of these new businesses at start-up and\r\n                during the first year.\r\n            </p>\r\n        </div>\r\n\r\n        <div class=\"col-md-4\">\r\n            <p>\r\n                The second part of this white paper will be devoted to\r\n                detailing how to insure you have the best list and data\r\n                available.\r\n            </p>\r\n\r\n            <p>\r\n                In fact, this D&B data may under report small business,\r\n                as the Small Business Administration reports that are nearly\r\n                30 million small businesses in the US  an open debate.\r\n                Regardless of the debate, there is no question that its a\r\n                large and growing market.\r\n\r\n            </p>\r\n\r\n            <p>\r\n                Number of New Business Started Each Year:\r\n\r\n            </p>\r\n\r\n            <p>\r\n                Counts from a leading and long- time compiler of new\r\n                business incorporations shows that on average there are between\r\n                150,000  200,000 new businesses started each month.\r\n                Thats right  on average 2 million new businesses are\r\n                begun each year. Obviously this number is not constant,\r\n                as many factors impact how many are started each month.\r\n            </p>\r\n\r\n            <p>\r\n                Yet, as we have endured economically difficult times,\r\n                a larger portion of these new businesses are being started\r\n                by experienced people who have decided to leave their\r\n                positions or have been a victim of layoffs,\r\n                closings and/or mergers. Therefore, a significant\r\n                number are starting businesses with great experience,\r\n                contacts and financial resources.\r\n            </p>\r\n\r\n\r\n        </div>\r\n\r\n    </div>\r\n\r\n</div>";

