	module.exports = "<div class=\"row page003\">\r\n    <div class=\"col-md-8\">\r\n\r\n        <div class=\"row m-b-1\">\r\n            <div class=\"col-sm-12 text-sm-center\">\r\n                <h4>Some Facts and Insights about New Businesses:</h4>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"row\">\r\n            <div class=\"col-sm-12 m-x-2\">\r\n                There is much reported about the new and small business\r\n                segment, as over time statistics indicate that not only\r\n                are most new jobs created by these companies (an often\r\n                quoted statistic is 70%), but great economic output is\r\n                produced as well. On the other hand, many misperceptions\r\n                and unfounded opinions exist about these startups as well.\r\n                So whats the truth? Here are a variety of facts and\r\n                insights drawn from an array of sources including the\r\n                Small Business Administration and their sponsored\r\n                working paper, Startup Business Characteristics and\r\n                Dynamics: A Data Analysis of the Kauffman Firm Survey.\r\n            </div>\r\n        </div>\r\n\r\n\r\n        <div class=\"row\">\r\n            <div class=\"col-sm-12 m-x-2\">\r\n                <img src=\"" + __webpack_require__(282) + "\" class=\"img-fluid\" style=\"width: 100%;\" />\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"row\">\r\n            <div class=\"col-sm-12 m-x-2\">\r\n                TO SUM UP:\r\n                If you are looking for new customers, the new business\r\n                market might represent an opportunity that before now\r\n                has been untapped and undervalued. This market is\r\n                probably larger and more substantial than initially\r\n                perceived. Certainly, a well-designed direct marketing\r\n                campaign should be developed and tested to prove\r\n                the potential for your product or service. But,\r\n                if it works, there will be a constant flow of\r\n                new opportunities as the rate of new business\r\n                startups is high and growing. Take advantage\r\n                of it now, before your competitors do!\r\n            </div>\r\n        </div>\r\n\r\n\r\n\r\n\r\n    </div>\r\n\r\n\r\n    <div class=\"col-md-4\">\r\n        <div class=\"row\">\r\n            <div class=\"col-sm-12 m-x-1\" style=\"padding:0;\">\r\n                <img src=\"" + __webpack_require__(283) + "\" class=\"img-fluid\" style=\"width: 100%;\" />\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"row m-y-1\">\r\n            <div class=\"col-sm-12 m-x-1 text-sm-center\">\r\n                <h4>FACTS</h4>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"row\">\r\n            <div class=\"col-sm-12 m-x-1\" style=\"background-color:#B8CCDD;\">\r\n                Small business employ a little more than\r\n                half of all private sector workers, pay\r\n\r\n                <b>44% of total U.S. private payroll</b>\r\n\r\n                and have generated 64% of net new jobs over the\r\n                past 15 years, according to the SBAs Office of Advocacy.\r\n                ( <b>Over 93% of all startups were new, independent businesses</b>;\r\n                about 7% were purchased or are franchises.\r\n                Obviously franchised and purchased firms have a\r\n                higher level of assets, profits, revenues and wages\r\n                than newly created firms. (About half of the startups\r\n                are home based, another\r\n                <b>40% operate their business at rented or leased facilities</b>\r\n                , and the remaining have\r\n                purchased their own offices/plants. (The overall\r\n                <b>survival rate after one year was 94%</b>\r\n                (much higher than popular opinions have led us to believe), but that varies\r\n                based on the type of businesses. From a\r\n                high of 97% for rental and leasing firms to a low of 89% for\r\n                accommodation and food service businesses. (Business failures\r\n                do occur over time, but also long standing businesses fail as is evidenced by the\r\n                empty store fronts in all of our local communities. (The statistics\r\n                for new business failure are hard to accurately determine, but the widely accepted rate is\r\n                50%+ will fail in 5 years. (In 2006 for home-based business the\r\n                <b>four largest types of business</b>\r\n                (based on the two-digit NAICS code)\r\n                were: (o31% professional services o13% manufacturing o\r\n                10% construction o10% administrative services)  (<b>Non-home based business</b>\r\n                showed a somewhat different split by type o 23% manufacturing (o 17%\r\n                professional services o 14% retail trade\r\n\r\n                o 6% professional services Non-home based startup businesses created\r\n                <b>an average of 5.5 jobs per firm</b> that\r\n                averaged 4.1 paid employees in addition to\r\n                1.4 entrepreneurial positions. Clearly, larger in size than new home-based businesses.\r\n\r\n            </div>\r\n\r\n        </div>\r\n    </div>\r\n</div>";

